import React from "react";
import Logo from "../images/logo.png";
import { Button } from "react-bootstrap";
import "./style.css";

export default function Main() {
  return (
    <>
      <img src={Logo} width="200px" />
      <ul className="nav">
          <li>Transitional Planning</li>
          <li>Alternative Paths</li>
          <li>Community</li>
      </ul>
    </>
  );
}
